def solution(stdin: str) -> str:
    _, N = stdin.split()
    M = int(N)
    _, *a = map(int, stdin.split())
    n = len(a)
    if N == 1:
        return f'{1}'
    dp = [[1] * N for _ in range(n)]
    # k is the step, j is the step from k to j, dp[i][k] = dp[i][k - a[i]] + dp[i + 1][k - a[i + 1]]
    for k in range(N):
        for j in range(k):
            dp[k][j] = (dp[k][j] + dp[k - a[j]][j]) % 1000000007
    return f'{dp[-1][-1]}'

