        parent = {start_node: start_node}

        total_weight = weights[0]

        while queue:
            node = queue.pop()

            for adj in graph[node]:
                if adj not in parent:
                    parent[adj] = node
                    queue.add(adj)
                    total_weight += weights[adj - 1]

        return total_weight

